import React, { Component } from "react";
import {
    NavLink,
} from "react-router-dom";
import delighters from "../common/delighters";

class Works extends Component {
    componentDidMount() {
        delighters.init();
    }
    render() {
        return (
            <div className="works container">
                <ul>
                    <li>
                        <NavLink to="/worksDetail">
                            <img src="/img/img-works-01.png" alt=""/>
                            <h2><NavLink to="/worksDetail">METAL REVISION.INC</NavLink></h2>
                            <p>Freelance job / Website</p>
                            <div className="blue" data-delighter></div>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/worksDetail"><img src="/img/img-works-01.png" alt=""/></NavLink>
                        <div className="blue" data-delighter></div>
                    </li>
                    <li>
                        <NavLink to="/worksDetail"><img src="/img/img-works-01.png" alt=""/></NavLink>
                        <div className="blue" data-delighter></div>
                    </li>
                    <li>
                        <NavLink to="/worksDetail"><img src="/img/img-works-01.png" alt=""/></NavLink>
                        <div className="blue" data-delighter></div>
                    </li>
                    <li>
                        <NavLink to="/worksDetail"><img src="/img/img-works-01.png" alt=""/></NavLink>
                        <div className="blue" data-delighter></div>
                    </li>
                </ul>
            </div>
        );
    }
}

export default Works;
